// import React from "react";
import {React, useRef, useState} from "react";
import Form from "react-bootstrap/Form";
import InputGroup from "react-bootstrap/InputGroup";
import FormControl from "react-bootstrap/FormControl";
// import Button from "react-bootstrap/Button";




// import React, { useState } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import { baseUrl } from "../URL/AppConstants";

import { Button, Col, Container,  Row } from "react-bootstrap";
const Register = () => {
  const [profile, setprofile] = useState({
    // address: {
    //   city: " ",
    //   country: " ",
    //   house: " ",
    //   state: " ",
    //   street: " ",
    // },
    contactNumber: "",
    date: "",
    email: "",
    firstName: "",
    gender: "",
    lastName: "" ,
    password: "",
    username: "",
  });
  const [address,setaddress] = useState({
    house: "",
    street: "",
    city: "",
    state: "",
    country: "",
  });
  const [formErrors, setFormErrors] = useState({});
  const handleChange = (event) => {
    setprofile((profile) => ({
      ...profile,
      [event.target.name]: event.target.value,
    }));
  };
  const handleSubmit = () => {
    let errors = {};
    if (!profile. firstName) {
      errors["firstNameErr"] = "Enter First Name";
    }
    if (!profile.lastName) {
      errors["lastNameErr"] = "Enter Last Name";
    }
    if (!profile.email) {
      errors["emailErr"] = "Enter Email Id";
    }
    if (!profile.contactNumber) {
      errors["contactNumberErr"] = "Enter Contact Number";
    }
    if (!profile.date) {
      errors["dateErr"] = "Enter Date OF Birth";
    }
    if (!profile.username) {
      errors["usernameErr"] = "Enter UserName";
